// import './estilo.css'
import React from 'react';
import { Button, TextField } from '@material-ui/core';
function DadosEntrega() {
    
    const [cep, setCep] = useState("");
    const [numero, setNumero] = useState("");
    const [complemento, setComplemento] = useState("");
    const [endereco, setEndereco] = useState("");
    const [estado, setEstado] = useState("");
    const [cidade, setCidade] = useState("");
    
    return (
        <form>
            <TextField
                value={cep}
                onChange={(event) => {
                    setCep(event.target.value);
                }}
                id="cep"
                label="CEP"
                type="number"
                variant="outlined"
                margin="normal"
            />

            <Button
                variant="text"
                color="secondary"
                type="submit">
                Não sei meu CEP
            </Button>

            <TextField
            value={numero}
            onChange={(event) => {
                setNumero(event.target.value);
            }}
                id="numero"
                label="Número"
                type="number"
                variant="outlined"
                margin="normal"
            />

            <TextField
            value={complemento}
            onChange={(event) => {
                setComplemento(event.target.value);
            }}
                id="Complemento"
                label="Complemento"
                type="text"
                variant="outlined"
                margin="normal"
            />

            <TextField
            value={endereco}
            onChange={(event) => {
                setEndereco(event.target.value);
            }}
                id="endereco"
                label="Endereço"
                type="text"
                variant="outlined"
                margin="normal"
                fullWidth
            />

            <TextField
            value={estado}
            onChange={(event) => {
                setEstado(event.target.value);
            }}
                id="estado"
                label="Estado"
                type="text"
                variant="outlined"
                margin="normal"
            />
            <TextField
            value={cep}
                id="cidade"
                label="Cidade"
                type="text"
                variant="outlined"
                margin="normal"
            />

            <Button
                variant="contained"
                color="primary"
                type="submit"
                fullWidth>
                Avançar
            </Button>

        </form>
    )
}

export default DadosEntrega;
